    data: |
      SELECT col0 * + ( + + col2 ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE 79 NOT IN ( + - 63 * + 26 + + + col1 );
  - name: tab1

outputs:
  - name: q7535.out
    data: |
      4896
      5015
      6188
